import "./banner.css";

function Banner() {
  return (
    <div className="banner container-fluid justify-content-center">
      <ul className="justify-content-center">
        <li className="bannerItem">Attentive</li>
        <li className="bannerItem">Approachable</li>
        <li className="bannerItem">Affordable</li>
      </ul>
    </div>
  );
}

export default Banner;
